import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the price filter visible, we first need to perform a search.
    await page.getByPlaceholder('Search Amazon').fill('headphones');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_term_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_term_entered.png'));

    // Click the search button
    await page.locator('button.search-btn').first().click();

    // Wait for the price filter to appear on the search results page
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Fill in the minimum price
    const minPriceInput = page.locator('#minPrice');
    await minPriceInput.fill('50');

    // Fill in the maximum price
    const maxPriceInput = page.locator('.price-input[placeholder="Max"]');
    await maxPriceInput.fill('150');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_range_filled.png'));

    // Click the apply filter button
    await page.getByRole('button', { name: 'Apply' }).click();

    // A small wait to let potential UI updates happen after the click
    await page.waitForTimeout(500);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_filter_applied.png'));

    // Extract data to verify
    const extractedData = {
      minPrice: await minPriceInput.inputValue(),
      maxPrice: await maxPriceInput.inputValue()
    };

    return {
      success: true,
      action: "Applied price range filter from $50 to $150.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
